INSERT INTO "empleados" VALUES(1,1,'Davolio','Nancy','Representante de ventas','Srta.',25180,33725,'507 - 20th Ave. E.
INSERT INTO "empleados" VALUES(2,2,'Fuller','Andrew','Vicepresidente comercial','Dr.',19043,33830,'908 W. Capital Way','Tacoma','WA','98401','EE.UU.','(206) 555-9482','3457','Andrew completó su licenciatura en Comercio y un doctorado en Marketing Internacional de la Universidad de Dallas. Habla con fluidez en francés e italiano y lee el alemán. Ingresó en la empresa como representante de ventas, fue ascendido a gerente de cuen',NULL);
INSERT INTO "empleados" VALUES(3,3,'Leverling','Janet','Representante de ventas','Srta.',23253,33695,'722 Moss Bay Blvd.','Kirkland','WA','98033','EE.UU.','(206) 555-3412','3355','Janet es licenciada en Química por la Universidad de Boston. También ha completado un programa de formación en Gestión de minoristas de alimentación. Janet fue contratada como vendedora asociada y fue ascendida a representante de ventas.','Fuller, Andrew');
INSERT INTO "empleados" VALUES(4,4,'Peacock','Margaret','Representante de ventas','Sra.',21447,34092,'4110 Old Redmond Rd.','Redmond','WA','98052','EE.UU.','(206) 555-8122','5176','Margaret es licenciada en Literatura inglesa por el Colegio Universitario Concordia, y tiene un máster del Instituto Americano de Artes Culinarias. Estuvo asignada temporalmente a la oficina de Londres antes de regresar a su puesto permanente en Seattle.','Fuller, Andrew');
INSERT INTO "empleados" VALUES(5,5,'Buchanan','Steven','Gerente de ventas','Sr.',20152,34259,'14 Garrett Hill','Londres',NULL,'SW1 8JR','Reino Unido','(71) 555-4848','3453','Steven Buchanan se graduó en la Universidad de St. Andrews, Escocia. Tras su ingreso en la empresa dedicó 6 meses a un programa de orientación en la oficina de Seattle y luego volvió a su puesto permanente en Londres, donde fue ascendido a gerente de vent','Fuller, Andrew');
INSERT INTO "empleados" VALUES(6,6,'Suyama','Michael','Representante de ventas','Sr.',23194,34259,'Coventry House
INSERT INTO "empleados" VALUES(7,7,'King','Robert','Representante de ventas','Sr.',22065,34336,'Edgeham Hollow
INSERT INTO "empleados" VALUES(8,8,'Callahan','Laura','Coordinador ventas interno','Srta.',21194,34398,'4726 - 11th Ave. N.E.','Seattle','WA','98105','EE.UU.','(206) 555-1189','2344','Laura se graduó en Psicología por la Universidad de Washington. También completó un curso de francés de negocios. Lee y escribe en francés.','Fuller, Andrew');
